window.bookSummaryJSON = "<p>Best-selling author and peak performance expert Steven Kotler decodes the secrets of those elite performers - athletes, artists, scientists, CEOs, and more - who have changed our definition of the possible, teaching us how we too can stretch far beyond our capabilities, making impossible dreams much more attainable for all of us.</p> <p>What does it take to accomplish the impossible? What does it take to shatter our limitations, exceed our expectations, and turn our biggest dreams into our most recent achievements? We are capable of so much more than we know - thatâ€™s the message at the core of <i>The Art of Impossible</i>. </p> <p>Building upon cutting-edge neuroscience and more than 20 years of research, best-selling author, peak performance expert and executive director of the Flow Research Collective, Steven Kotler lays out a blueprint for extreme performance improvement. If you want to aim high, here is the playbook to make it happen!</p> <p>Inspirational and aspirational, pragmatic and accessible, <i>The Art of Impossible</i> is a life-changing experience disguised as a how-to manual for peak performance that anyone can use to shoot for the stars...space suit not included. </p>"; 
